  input: TEXT,F3XA,,"Response to letter dated May 18, 2005; period covered 9/01/04-9/30/04.  This
    response follows each bullet point.  Report for September and October have been
    amended to reflect the transfers-in from DNC/Services Corp.  Changes to the memo
    entries have been made to correct missing information which takes care of the
    2nd and 3rd bullets.   The Aggregate Gen Election Expenditures total has been
    corrected by the filing of previous amendments.  This total is out of balance
    with your calculation by $10. Bullets 5, 6, & 7 have been addressed by moving
    expenses to the proper schedule.  All interns that were contracted with the Democratic
    Party of SC at the time were independent contractors.  They were not performing
    functions that would be characterized as FEA.   The payments for printing have
    been clarified or moved.  Each of the 31indentifiers recorded as 'expense reimbursement'
    were for staff persons being reimbursed for mileage/gas, office supplies (including
    paper, pens, tape, equipment),cell telephone use, or meals.  Other non specific
    indentifiers have been corrected to more accurate descriptions.  Each of the 120
    expense reimbursement indentifiers cited as 'Internship-voter id and expense reimburs'
    were reimbursements for either mileage/gas or cell telephone use during the reporting
    period.  Every effort is made to file accurate and timely reports with the Commission."
